import React from 'react';

const Background = ({ children }) => {
    return (
        <div style={{
            minHeight: '100vh',
            background: 'linear-gradient(135deg, #fafafa 0%, #f4f4f5 100%)',
            position: 'relative',
            overflow: 'hidden'
        }}>
            {/* Clean 3D shapes matching the reference image */}
            <div style={{ position: 'absolute', inset: 0, pointerEvents: 'none' }}>
                {/* Yellow circle - top left (like in image) */}
                <div style={{
                    position: 'absolute',
                    top: '10px',
                    left: '10px',
                    width: '200px',
                    height: '200px',
                    background: 'linear-gradient(145deg, #fef3c7 0%, #fbbf24 100%)',
                    borderRadius: '50%',
                    boxShadow: '0 15px 30px rgba(251, 191, 36, 0.15)',
                    zIndex: 2
                }}></div>

                {/* Large blue shape - left side with curved organic form */}
                <div style={{
                    position: 'absolute',
                    top: '150px',
                    left: '-200px',
                    width: '450px',
                    height: '600px',
                    background: 'linear-gradient(145deg, #93c5fd 0%, #3b82f6 70%, #1e40af 100%)',
                    borderRadius: '50% 40% 60% 50%',
                    transform: 'rotate(-5deg)',
                    boxShadow: '0 40px 80px rgba(59, 130, 246, 0.2)',
                    zIndex: 1
                }}></div>

                {/* Purple overlay layer inside blue (like in image) */}
                <div style={{
                    position: 'absolute',
                    top: '200px',
                    left: '-150px',
                    width: '350px',
                    height: '500px',
                    background: 'linear-gradient(145deg, #c4b5fd 0%, #8b5cf6 50%, #7c3aed 100%)',
                    borderRadius: '45% 50% 55% 45%',
                    transform: 'rotate(10deg)',
                    opacity: 0.8,
                    zIndex: 2
                }}></div>

                {/* Pink shape - bottom right */}
                <div style={{
                    position: 'absolute',
                    bottom: '-100px',
                    right: '-50px',
                    width: '300px',
                    height: '250px',
                    background: 'linear-gradient(145deg, #fce7f3 0%, #f472b6 100%)',
                    borderRadius: '60% 40% 70% 30%',
                    boxShadow: '0 25px 50px rgba(244, 114, 182, 0.15)',
                    zIndex: 1
                }}></div>
            </div>

            {/* Clean Menu Bar */}
            <nav style={{
                position: 'relative',
                zIndex: 10,
                background: 'rgba(255, 255, 255, 0.9)',
                backdropFilter: 'blur(10px)',
                borderBottom: '1px solid rgba(0, 0, 0, 0.04)'
            }}>
                <div style={{
                    maxWidth: '1200px',
                    margin: '0 auto',
                    padding: '16px 32px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'space-between'
                }}>
                    {/* Logo */}
                    <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
                        <img
                            src="https://via.placeholder.com/36x36/3b82f6/ffffff?text=I"
                            alt="Logo"
                            style={{
                                width: '36px',
                                height: '36px',
                                borderRadius: '8px'
                            }}
                        />
                        <h1 style={{
                            fontSize: '18px',
                            fontWeight: '600',
                            color: '#1f2937',
                            margin: 0,
                            fontFamily: 'system-ui, -apple-system, sans-serif'
                        }}>Iconic</h1>
                    </div>

                    {/* Menu Items */}
                    <div style={{ display: 'flex', alignItems: 'center', gap: '40px' }}>
                        <a href="#" style={{
                            color: '#4b5563',
                            textDecoration: 'none',
                            fontSize: '15px',
                            fontWeight: '500',
                            fontFamily: 'system-ui, -apple-system, sans-serif'
                        }}>Giới thiệu</a>
                        <a href="#" style={{
                            color: '#4b5563',
                            textDecoration: 'none',
                            fontSize: '15px',
                            fontWeight: '500',
                            fontFamily: 'system-ui, -apple-system, sans-serif'
                        }}>Bài viết</a>
                        <a href="#" style={{
                            color: '#4b5563',
                            textDecoration: 'none',
                            fontSize: '15px',
                            fontWeight: '500',
                            fontFamily: 'system-ui, -apple-system, sans-serif'
                        }}>Pages</a>
                        <a href="#" style={{
                            color: '#4b5563',
                            textDecoration: 'none',
                            fontSize: '15px',
                            fontWeight: '500',
                            fontFamily: 'system-ui, -apple-system, sans-serif'
                        }}>Liên hệ</a>
                    </div>

                    {/* Language selector */}
                    <select style={{
                        background: 'white',
                        border: '1px solid #e5e7eb',
                        borderRadius: '6px',
                        padding: '6px 12px',
                        color: '#4b5563',
                        fontSize: '14px',
                        fontWeight: '500',
                        cursor: 'pointer',
                        outline: 'none',
                        fontFamily: 'system-ui, -apple-system, sans-serif'
                    }}>
                        <option>Tiếng việt</option>
                        <option>English</option>
                    </select>
                </div>
            </nav>

            {/* Main Content Area */}
            <div style={{
                position: 'relative',
                zIndex: 10,
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                minHeight: 'calc(100vh - 80px)',
                padding: '40px 24px'
            }}>
                <div style={{ width: '100%', maxWidth: '440px' }}>
                    {/* Clean form container */}
                    <div style={{
                        background: 'rgba(255, 255, 255, 0.95)',
                        borderRadius: '12px',
                        border: '1px solid rgba(255, 255, 255, 0.9)',
                        boxShadow: '0 4px 20px rgba(0, 0, 0, 0.08)',
                        overflow: 'hidden'
                    }}>
                        {children}
                    </div>
                </div>
            </div>

            {/* Simple hover effects */}
            <style>{`
        nav a:hover {
          color: #3b82f6 !important;
        }
        
        nav select:hover {
          border-color: #3b82f6 !important;
        }

        /* Clean responsive */}
        @media (max-width: 768px) {
          nav > div {
            padding: 12px 20px;
            gap: 20px;
          }
          
          nav > div > div:nth-child(2) {
            gap: 24px;
          }
        }
      `}</style>
        </div>
    );
};

export default Background;
